const { MongoClient } = require('mongodb');

async function sendNewUser(data) {
  const uri = 'mongodb://127.0.0.1:27017/?directConnection=true&serverSelectionTimeoutMS=2000&appName=mongosh+2.3.9';
  const client = new MongoClient(uri);
  try {
    await client.connect();
    const database = client.db('baumna_data');
    const collection = database.collection('users');
    const result = await collection.insertOne(data);
    console.log(`Data inserted with _id: ${result.insertedId}`);
  } catch (error) {
    console.error(error);
  } finally {
    await client.close();
  }
}

export default sendNewUser;
